import React from "react";



function Card(params) {
    return (
        <>
            <div class="card">
                <img src="https://source.unsplash.com/user/erondu/200x200" class="card-img-top" alt="random-image" />
                <div class="card-body">
                    <h5 class="card-title"> {this.props.card_title} </h5>
                    <p class="card-text"> {params.card_text} </p>
                    <a href="#"> {params.card_link} </a>
                </div>
            </div>
        </>
    );
}

